import React, { useState } from "react";

const Log = () => {
  const [username, setUsername] = useState();

  return (
    <React.Fragment >
        <input
          type="text"
          placeholder="Enter Username"
          value=""
          className="user-name"
        ></input>
        <input
          type="text"
          placeholder="Enter Password"
          value=""
          className="pass-word"
        ></input>
          <button onClick={null} className="log-btn">Log In</button>
    </React.Fragment>
  );
};

export default Log;
